import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import Link from 'react-router-dom'
function Header({user}) {
  return (<Navbar style={{ color: "white" }} expand="lg">
    <Container>
    <Navbar.Brand style={{ color: "white" }} href="">Join The Band</Navbar.Brand>

    <Navbar.Brand style={{ color: "white" }} href="login">Log In</Navbar.Brand>
      <Navbar.Brand style={{ color: "white" }} href="signup">Sign Up</Navbar.Brand>

      <Navbar.Toggle aria-controls="basic-navbar-nav" />
  </Container>
</Navbar>)
}
export default Header;
